import React from 'react'
import Nav from '../components/Nav'
import Footer from '../components/Footer'
import Contact from '../components/Contact'

export default function ContactUs() {
  return (
    <div>
      <Nav/>
      <Contact/>
      <Footer/>
    </div>
  )
}
